import React from 'react';
import { BoardList } from '../components';

class Board extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      memberList: []
    };
  }

  // componentDidMount() {
  //   this._getList();
  // }

  // _getList() {
  //   const apiUrl = '../store/modules/member.js';

  //   axios.get(apiUrl).then(data => {
  //     this.setState({
  //       member : data.data.member
  //     });
  //   })
  //   .catch(error => {
  //     console.log(error);
  //   })
  // }

  componentDidMount() {
    this.fetchApiToEntries('http://localhost:3000/store/modules/member');
  }
  fetchApiToEntries = (apiToFetch) => {
    fetch(apiToFetch)
        .then(result => result.json())
        .then((memberList) => {
          this.setState({
            ...this.state,
            memberList
          })
        })
        .catch((error) => console.log(error));
  }

  render() {
    const { memberList } = this.state;
    console.log(memberList);
    
    return(
      <div>
        <BoardList member={this.state.member} />
      </div>
    );
  }
}

export default Board;
